import React, { useState, useEffect, useCallback } from 'react';
import CreateDossierModal from './CreateDossierModal';
import PatientsList from './PatientsList';
import DossiersList from './DossiersList';
import { getData } from '../api/endpoint';

const DoctorDashboard = () => {
  const [activeSection, setActiveSection] = useState('dossiers');
  const [showCreateModal, setShowCreateModal] = useState(false);
  const [patientsCount, setPatientsCount] = useState(0);
  const [dossiersCount, setDossiersCount] = useState(0);

  // ‚úÖ Compteurs avec fallback localStorage
const updateCounts = useCallback(async () => {
  try {
    const [patientsRes, dossiersRes] = await Promise.all([
      getData('/patients').catch(() => []),
      getData('/mes-dossiers').catch(() => [])
    ]);
    
    const patients = Array.isArray(patientsRes) ? patientsRes : [];
    const dossiersApi = Array.isArray(dossiersRes) ? dossiersRes : [];
    
    const localDossiers = JSON.parse(
      localStorage.getItem('dossiersMedecin') || '[]'
    );
    
    setPatientsCount(patients.length);
    setDossiersCount(dossiersApi.length + localDossiers.length);
  } catch (err) {
    console.log('Comptage:', err);
    setPatientsCount(0);
    setDossiersCount(
      JSON.parse(localStorage.getItem('dossiersMedecin') || '[]').length
    );
  }
}, []);

  useEffect(() => {
    updateCounts();
    const interval = setInterval(updateCounts, 30000); // 30s
    return () => clearInterval(interval);
  }, [updateCounts]);

  const handleCreateSuccess = useCallback(() => {
    setShowCreateModal(false);
    updateCounts(); // Refresh sans reload
  }, [updateCounts]);

  return (
    <div style={{ padding: '2rem', maxWidth: '1400px', margin: '0 auto' }}>
      <header style={{ textAlign: 'center', marginBottom: '3rem' }}>
        <h1 style={{ color: '#1976d2', fontSize: '2.5rem', margin: '0' }}>üè• Espace M√©decin</h1>
        <p style={{ color: '#666', fontSize: '1.2rem', margin: '0.5rem 0 0 0' }}>
          Gestion patients & dossiers en temps r√©el
        </p>
      </header>

      {/* ‚úÖ BOUTONS ACTIONS PRINCIPALES */}
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))', 
        gap: '1.5rem', 
        marginBottom: '3rem' 
      }}>
        <ActionButton 
          icon="‚ûï" 
          title="Nouveau Dossier" 
          onClick={() => setShowCreateModal(true)}
          color="#4caf50"
          count={null}
        />
        <ActionButton 
          icon="üë•" 
          title={`Patients (${patientsCount})`} 
          onClick={() => setActiveSection('patients')}
          color="#2196f3"
          count={patientsCount}
        />
        <ActionButton 
          icon="üìÅ" 
          title={`Dossiers (${dossiersCount})`} 
          onClick={() => setActiveSection('dossiers')}
          color="#ff9800"
          count={dossiersCount}
        />
        <ActionButton 
          icon="üìä" 
          title="Statistiques" 
          onClick={() => setActiveSection('stats')}
          color="#9c27b0"
          count={null}
        />
      </div>

      {/* ‚úÖ CONTENU PRINCIPAL */}
      <div style={{ 
        background: 'white', 
        borderRadius: '16px', 
        boxShadow: '0 10px 40px rgba(0,0,0,0.1)', 
        overflow: 'hidden',
        minHeight: '500px'
      }}>
        {activeSection === 'patients' && <PatientsList />}
        {activeSection === 'dossiers' && <DossiersList />}
        {activeSection === 'stats' && <StatsSection />}
      </div>

      {/* ‚úÖ MODAL AVEC KEY UNIQUE */}
      {showCreateModal && (
        <div key="modal-overlay" style={{ position: 'fixed', zIndex: 9999, inset: 0 }}>
          <CreateDossierModal 
            key="create-dossier-modal"
            onClose={() => setShowCreateModal(false)}
            onSuccess={handleCreateSuccess}
          />
        </div>
      )}
    </div>
  );
};

// ‚úÖ ActionButton CORRIG√â (fonctionnel)
const ActionButton = ({ icon, title, onClick, color, count = null }) => {
  const buttonStyle = {
    padding: '2rem 1.5rem', 
    textAlign: 'center',
    background: `linear-gradient(135deg, ${color}, ${hexToRgb(color, 0.2)})`,
    color: 'white', 
    border: 'none', 
    borderRadius: '16px',
    fontSize: '1.3rem', 
    fontWeight: 'bold', 
    cursor: 'pointer',
    boxShadow: `0 8px 25px ${hexToRgb(color, 0.3)}`,
    transition: 'all 0.3s ease',
    position: 'relative',
    overflow: 'hidden',
    minHeight: '120px',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center'
  };

  return (
    <button 
      onClick={onClick} 
      style={buttonStyle}
      onMouseEnter={(e) => {
        e.target.style.transform = 'translateY(-5px) scale(1.02)';
        e.target.style.boxShadow = `0 15px 35px ${hexToRgb(color, 0.4)}`;
      }}
      onMouseLeave={(e) => {
        e.target.style.transform = 'translateY(0) scale(1)';
        e.target.style.boxShadow = `0 8px 25px ${hexToRgb(color, 0.3)}`;
      }}
    >
      <div style={{ fontSize: '2.5rem', marginBottom: '0.8rem' }}>{icon}</div>
      <div style={{ fontSize: '1.1rem' }}>{title}</div>
      {count !== null && count > 0 && (
        <div style={{
          position: 'absolute', 
          top: '1rem', 
          right: '1rem',
          background: '#f44336', 
          color: 'white', 
          borderRadius: '50%',
          width: '28px', 
          height: '28px', 
          fontSize: '0.9rem', 
          fontWeight: 'bold',
          display: 'flex', 
          alignItems: 'center', 
          justifyContent: 'center',
          boxShadow: '0 2px 8px rgba(244,67,54,0.4)'
        }}>
          {count}
        </div>
      )}
    </button>
  );
};

// ‚úÖ Utilitaire couleur CORRIG√â
const hexToRgb = (hex, alpha = 1) => {
  const result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
  if (!result) return hex;
  const r = parseInt(result[1], 16);
  const g = parseInt(result[2], 16);
  const b = parseInt(result[3], 16);
  return `rgba(${r}, ${g}, ${b}, ${alpha})`;
};

// ‚úÖ StatsSection am√©lior√©e
const StatsSection = () => {
  const localDossiers = JSON.parse(localStorage.getItem('dossiersMedecin') || '[]');
  
  return (
    <div style={{ padding: '3rem 2rem', textAlign: 'center' }}>
      <h2 style={{ color: '#1976d2', fontSize: '2rem', marginBottom: '2rem' }}>üìä Statistiques</h2>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', 
        gap: '2rem', 
        maxWidth: '800px', 
        margin: '0 auto' 
      }}>
        <div style={{ 
          padding: '2rem', 
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', 
          color: 'white', 
          borderRadius: '16px' 
        }}>
          <div style={{ fontSize: '3rem', fontWeight: 'bold' }}>{localDossiers.length}</div>
          <div style={{ fontSize: '1.1rem', opacity: 0.9 }}>Dossiers cr√©√©s</div>
        </div>
        <div style={{ 
          padding: '2rem', 
          background: 'linear-gradient(135deg, #f093fb 0%, #f5576c 100%)', 
          color: 'white', 
          borderRadius: '16px' 
        }}>
          <div style={{ fontSize: '3rem', fontWeight: 'bold' }}>0</div>
          <div style={{ fontSize: '1.1rem', opacity: 0.9 }}>Consultations aujourd'hui</div>
        </div>
        <div style={{ 
          padding: '2rem', 
          background: 'linear-gradient(135deg, #4facfe 0%, #00f2fe 100%)', 
          color: 'white', 
          borderRadius: '16px' 
        }}>
          <div style={{ fontSize: '3rem', fontWeight: 'bold' }}>100%</div>
          <div style={{ fontSize: '1.1rem', opacity: 0.9 }}>Taux d'activit√©</div>
        </div>
      </div>
    </div>
  );
};

export default DoctorDashboard;
